contract NestCoin is ERC20, Ownable {
function c_0x18b12d3f(bytes32 c__0x18b12d3f) internal pure {}

    //declaring the Name and Symbol of the token
    constructor() ERC20("NestCoin", "NCT") {c_0x18b12d3f(0xbd34397aa19469cbd5a166651e082ecf3f7527fd66ebdbb579ab9cb5db74c526); /* function */ 

        //pre-minting 10million nestcoin
c_0x18b12d3f(0xe64edf4372cf18b2c4235478a227daab489c367dadf153d7c3c6e7fe7c02e37b); /* line */ 
        c_0x18b12d3f(0x4216a4ec0a7ca7152cc01013eba095ac4d309cb8b9c401ba3ff30a378ef3b3aa); /* statement */ 
_mint(msg.sender, 10000000 * 10**decimals());
    }
     function mint(address to, uint256 amount) public onlyOwner {c_0x18b12d3f(0x18037c104609a2919dca1f8fcfe41fe8839097ec7e832601f47e614baa2e51a1); /* function */ 

c_0x18b12d3f(0xfbf3940830655c8a7377fdb0260bbd47c821dcf3206717828eedd9b25a9a4577); /* line */ 
        c_0x18b12d3f(0x97dfec03b05b970295eaf5626636e8e094092572b5d9c64b8e903e1b6138e705); /* statement */ 
_mint(to, amount);
    }
}

